  `rexp` int(11) NOT NULL DEFAULT '0' COMMENT '等级每个星星的经验',
  `expbasic` int(11) NOT NULL DEFAULT '0' COMMENT '积分变化基准值',
  `matchweight` int(11) NOT NULL DEFAULT '0' COMMENT '段位权重系数%',
  `expratie` int(11) NOT NULL DEFAULT '0' COMMENT '分差系数%%',
  `exprmin` int(11) NOT NULL DEFAULT '0' COMMENT '积分变化最小阈值',
  `exprmax` int(11) NOT NULL DEFAULT '0' COMMENT '积分变化最大比例值%',
  `losefactor` int(11) NOT NULL DEFAULT '0' COMMENT '扣分系数%',
  `resetmmr` int(11) NOT NULL DEFAULT '0' COMMENT 'MMR重置值',
  `maxmatchratio` int(11) NOT NULL DEFAULT '0' COMMENT '【小组匹配分】最大差距比例%',
  `lup` int(11) NOT NULL DEFAULT '0' COMMENT '升级时是否经验保留，0表示不保留，升到上一级，经验为0；1表示保留经验',
  `ldown` int(11) NOT NULL DEFAULT '0' COMMENT '降级时是否直接降级，0表示不直接降级，保留当前等级，经验为0；1表示直接降级，扣经验',
  `escapeexplose` int(11) NOT NULL DEFAULT '0' COMMENT '逃跑扣分',
  `escapecooldown` int(11) NOT NULL DEFAULT '0' COMMENT '逃跑禁赛冷却（秒）',
  `robot` int(11) NOT NULL DEFAULT '0' COMMENT '是否使用机器人凑数：0=否；1=是',
  `loseexptype` int(11) NOT NULL DEFAULT '0' COMMENT '失败积分扣除类型：0=不扣；1=扣',
  `winexpbonus` int(11) NOT NULL DEFAULT '0' COMMENT '连胜积分加成类型：0=无；1=加成',
  `flevelid` int(11) NOT NULL DEFAULT '0' COMMENT '本赛季第一次升级奖励物品id0',
  `flevelnum` int(11) NOT NULL DEFAULT '0' COMMENT '本赛季第一次升级奖励物品数量0',
  `rwid0` int(11) NOT NULL DEFAULT '0' COMMENT '奖励物品id0',
  `rwnum0` int(11) NOT NULL DEFAULT '0' COMMENT '奖励物品数量0',
  `rwid1` int(11) NOT NULL DEFAULT '0' COMMENT '奖励物品id1',
  `rwnum1` int(11) NOT NULL DEFAULT '0' COMMENT '奖励物品数量1',
  `rwid2` int(11) NOT NULL DEFAULT '0' COMMENT '奖励物品id2',
  `rwnum2` int(11) NOT NULL DEFAULT '0' COMMENT '奖励物品数量2',
  `rwid3` int(11) NOT NULL DEFAULT '0' COMMENT '奖励物品id3',
  `rwnum3` int(11) NOT NULL DEFAULT '0' COMMENT '奖励物品数量3',
  `ctimer` timestamp NOT NULL DEFAULT '1980-01-01 00:00:00' COMMENT '创建时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `rlevel` (`rlevel`)
) ENGINE=InnoDB AUTO_INCREMENT=176 DEFAULT CHARSET=utf8mb4;

