  `t1` int(11) NOT NULL DEFAULT '0' COMMENT '雷达芯片图纸Id',
  `t2` int(11) NOT NULL DEFAULT '0' COMMENT '机身芯片图纸Id',
  `t3` int(11) NOT NULL DEFAULT '0' COMMENT '机翼芯片图纸Id',
  `t4` int(11) NOT NULL DEFAULT '0' COMMENT '引擎芯片图纸Id',
  `t5` int(11) NOT NULL DEFAULT '0' COMMENT '涂层芯片图纸Id',
  `t6` int(11) NOT NULL DEFAULT '0' COMMENT '散热芯片图纸Id',
  `ctimer` timestamp NOT NULL DEFAULT '1980-01-01 00:00:00' COMMENT '创建时间',
  `utimer` timestamp NOT NULL DEFAULT '1980-01-01 00:00:00' COMMENT '更新时间',
  PRIMARY KEY (`id`),
  UNIQUE KEY `nid` (`userid`,`itemid`),
  KEY `userid` (`userid`),
  KEY `itemid` (`itemid`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4;

