  `specid1` int(11) NOT NULL DEFAULT '0' COMMENT '特殊武器1',
  `manact0` int(11) NOT NULL DEFAULT '0' COMMENT '机动动作0',
  `manact1` int(11) NOT NULL DEFAULT '0' COMMENT '机动动作1',
  `manact2` int(11) NOT NULL DEFAULT '0' COMMENT '机动动作2',
  `manact3` int(11) NOT NULL DEFAULT '0' COMMENT '机动动作3',
