  `fhit_mis` int(11) NOT NULL DEFAULT '0' COMMENT '总发射命中导弹数(逃跑不算)',
  `fall_can` int(11) NOT NULL DEFAULT '0' COMMENT '总发射机炮数(逃跑不算)',
  `fhit_can` int(11) NOT NULL DEFAULT '0' COMMENT '总发射命中机炮数(逃跑不算)',
  `fhurt_max` int(11) NOT NULL DEFAULT '0' COMMENT '单场最大伤害(逃跑不算)',
  `fkill_max` int(11) NOT NULL DEFAULT '0' COMMENT '单场最大击杀数(逃跑不算)',
  `fkillex_max` int(11) NOT NULL DEFAULT '0' COMMENT '单场最大助攻数(逃跑不算)',
  `fkillone` int(11) NOT NULL DEFAULT '0' COMMENT '单条命最大击杀数(逃跑不算)',
  `fmvp` int(11) NOT NULL DEFAULT '0' COMMENT 'MVP总次数',
  `ctimer` timestamp NOT NULL DEFAULT '1980-01-01 00:00:00' COMMENT '获得时间',
  `utimer` timestamp NOT NULL DEFAULT '1980-01-01 00:00:00' COMMENT '获得时间',
  `expall` int(11) NOT NULL DEFAULT '0' COMMENT '玩家排位赛曾当前总经验，跟expmaxtimer一起组成排序',
  `expmax` int(11) NOT NULL DEFAULT '0' COMMENT '玩家排位赛曾经到达最大经验',
  `expmaxtimer` int(11) NOT NULL DEFAULT '0' COMMENT '玩家排位赛曾经到达最大经验的时间，用于排序',
  `fkda` float NOT NULL DEFAULT '0' COMMENT 'KDA战损值(逃跑不算)，KDA值  = （K + A*70%）/ MAX(D,1),K = 单场击杀数,D = 单场死亡数,A = 单场助攻数(每一场比赛都有自己的KDA)',
  `fkda_max` float NOT NULL DEFAULT '0' COMMENT '最高KDA',
  `fwinrate` int(11) NOT NULL DEFAULT '0' COMMENT '胜率(万分比)',
  `mmr` float NOT NULL DEFAULT '0' COMMENT 'mmr分数',
  `mmr_m2` float NOT NULL DEFAULT '0' COMMENT 'mmr公式中的M2',
  `mmr_m4` float NOT NULL DEFAULT '0' COMMENT 'mmr公式中的M4',
