  KEY `rankid` (`rankid`),
  KEY `userid` (`userid`),
  KEY `expall` (`expall`),
  KEY `expmaxtimer` (`expmaxtimer`),
  KEY `orderuser` (`expall`,`expmaxtimer`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4;

