-- ----------------------------
-- Procedure structure for `center_account_change`
-- ----------------------------
DROP PROCEDURE IF EXISTS `center_account_change`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `center_account_change`(IN `in_idA` bigint,IN `in_idB` bigint)
BEGIN
	update center_account set id = 999 where id = `in_idA`;
	update center_account set id = `in_idA` where id = `in_idB`;
	update center_account set id = `in_idB` where id = 999;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `center_account_exist`
-- ----------------------------
DROP PROCEDURE IF EXISTS `center_account_exist`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `center_account_exist`(IN `in_usvrid` int,IN `in_openid` varchar(191))
BEGIN
	select count(id) from center_account where usvrid = `in_usvrid` and openid = `in_openid`;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `center_account_insert`
-- ----------------------------
DROP PROCEDURE IF EXISTS `center_account_insert`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `center_account_insert`(IN `in_usvrid` int,IN `in_openid` varchar(191))
BEGIN
	select count(id),id from center_account where usvrid = `in_usvrid` and openid = `in_openid` into @nNum,@nId;
	if @nNum > 0 then
		select @nId;
	else
		select last_insert_id();
	end if;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `center_account_select`
-- ----------------------------
DROP PROCEDURE IF EXISTS `center_account_select`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `center_account_select`(IN `in_id` int)
BEGIN
	select id,usvrid,openid,UNIX_TIMESTAMP(ctimer),UNIX_TIMESTAMP(utimer) from center_account where id = `in_id`;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `data_actdata_insert`
-- ----------------------------
DROP PROCEDURE IF EXISTS `data_actdata_insert`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `data_actdata_insert`(IN `in_dataid` int,IN `in_sid` varchar(255),IN `in_dsid` varchar(255),IN `in_name` varchar(255),
																IN `in_type` int,IN `in_title` varchar(255),IN `in_content` varchar(4096),IN `in_piccontent` varchar(255),IN `in_button` varchar(255),
																IN `in_sortid` int,IN `in_data0` int,IN `in_data1` int,IN `in_data2` int,IN `in_data3` int,IN `in_btimer` varchar(255),IN `in_etimer` varchar(255))
BEGIN
										`in_dataid`,`in_sid`,`in_dsid`,`in_name`,`in_type`,`in_title`,`in_content`,`in_piccontent`,
										`in_button`,`in_sortid`,`in_data0`,`in_data1`,`in_data2`,`in_data3`,`in_btimer`,`in_etimer`,now());
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `data_actdata_select`
-- ----------------------------
DROP PROCEDURE IF EXISTS `data_actdata_select`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `data_actdata_select`()
BEGIN
	select dataid,sid,dsid,name,type,title,content,piccontent,button,sortid,data0,data1,data2,data3,UNIX_TIMESTAMP(btimer),UNIX_TIMESTAMP(etimer) from data_actdata where now() < etimer;
