-- ----------------------------
-- Procedure structure for `data_libaoma_user_get`
-- ----------------------------
DROP PROCEDURE IF EXISTS `data_libaoma_user_get`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `data_libaoma_user_get`(IN `in_sid` int,IN `in_userid` int,IN `in_series` varchar(32))
BEGIN
	#错误码：2礼包码不存在或者过期，3玩家渠道不对，4礼包码类型错误，5礼包码已经领取，6同一编组礼包码已经领取完了
	select count(*),itemid0,itemnum0,itemid1,itemnum1,itemid2,itemnum2,itemid3,itemnum3,sid,gid,gnum,getuserid,type from data_libaoma where series = `in_series` and now() < `etimer` 
					into @nNum,@nItem0,@nItemNum0,@nItem1,@nItemNum1,@nItem2,@nItemNum2,@nItem3,@nItemNum3,@nSid,@nGId,@nGNum,@nGetUserId,@nType;
	if @nNum > 0 then
		if @nSid = 0 or @nSid = `in_sid` then
			if @nType = 1 then#1表示只能一个玩家领取
				call data_libaoma_user_get_1(`in_userid`,`in_series`,@nGetUserId,@nGId,@nGNum,@nItem0,@nItemNum0,@nItem1,@nItemNum1,@nItem2,@nItemNum2,@nItem3,@nItemNum3);
			elseif @nType = 2 then#2表示符合条件的玩家就能领取，但是只能领取一次
				call data_libaoma_user_get_2(`in_userid`,`in_series`,@nGetUserId,@nGId,@nGNum,@nItem0,@nItemNum0,@nItem1,@nItemNum1,@nItem2,@nItemNum2,@nItem3,@nItemNum3);
			else#礼包码类型不对
				select 4,0,0,0,0,0,0,0,0,`in_series`;
			end if;			
		else#玩家渠道不对
			select 3,0,0,0,0,0,0,0,0,`in_series`;
		end if;			
	else#没有礼包码
		select 2,0,0,0,0,0,0,0,0,`in_series`;
	end if;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `data_libaoma_user_get_1`
-- ----------------------------
DROP PROCEDURE IF EXISTS `data_libaoma_user_get_1`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `data_libaoma_user_get_1`(IN `in_userid` int,IN `in_series` varchar(32),IN `in_getuserid` int,IN `in_gid` int,IN `in_gnum` int,IN `in_itemid0` int,IN `in_itemnum0` int,IN `in_itemid1` int,IN `in_itemnum1` int,IN `in_itemid2` int,IN `in_itemnum2` int,IN `in_itemid3` int,IN `in_itemnum3` int)
BEGIN
	if @nGetUserId = 0 then
		select count(*) from data_libaoma where gid = @nGId and getuserid = `in_userid` into @nNum;
		if @nNum < @nGNum then#成功
			update data_libaoma set getuserid = `in_userid`,dtimer = now() where series = `in_series`;
			select 0,`in_itemid0`,`in_itemnum0`,`in_itemid1`,`in_itemnum1`,`in_itemid2`,`in_itemnum2`,`in_itemid3`,`in_itemnum3`,`in_series`;
		else#同一编组礼包码已经领取完了
			select 6,0,0,0,0,0,0,0,0,`in_series`;
		end if;
	else#礼包码已经领取
		select 5,0,0,0,0,0,0,0,0,`in_series`;
	end if;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `data_libaoma_user_get_2`
-- ----------------------------
DROP PROCEDURE IF EXISTS `data_libaoma_user_get_2`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `data_libaoma_user_get_2`(IN `in_userid` int,IN `in_series` varchar(32),IN `in_getuserid` int,IN `in_gid` int,IN `in_gnum` int,IN `in_itemid0` int,IN `in_itemnum0` int,IN `in_itemid1` int,IN `in_itemnum1` int,IN `in_itemid2` int,IN `in_itemnum2` int,IN `in_itemid3` int,IN `in_itemnum3` int)
BEGIN
	select count(*) from data_libaoma_user where userid = `in_userid` and series = `in_series` into @nNum;
	if @nNum < 1 then
		select count(*) from data_libaoma where gid = @nGId and getuserid = `in_userid` into @nNum;
		if @nNum < @nGNum then#成功
			select 0,`in_itemid0`,`in_itemnum0`,`in_itemid1`,`in_itemnum1`,`in_itemid2`,`in_itemnum2`,`in_itemid3`,`in_itemnum3`,`in_series`;
		else#同一编组礼包码已经领取完了
			select 6,0,0,0,0,0,0,0,0,`in_series`;
		end if;
	else#礼包码已经领取
		select 5,0,0,0,0,0,0,0,0,`in_series`;
	end if;
END
;;
DELIMITER ;

