																																IN `in_radar` int,IN `in_c_radar` varchar(255),IN `in_g_radar` varchar(255),
																																IN `in_fuselage` int,IN `in_c_fuselage` varchar(255),IN `in_g_fuselage` varchar(255),
																																IN `in_wing` int,IN `in_c_wing` varchar(255),IN `in_g_wing` varchar(255),
																																IN `in_engine` int,IN `in_c_engine` varchar(255),IN `in_g_engine` varchar(255),
																																IN `in_coating` int,IN `in_c_coating` varchar(255),IN `in_g_coating` varchar(255),
																																IN `in_radiating` int,IN `in_c_radiating` varchar(255),IN `in_g_radiating` varchar(255))
BEGIN
																	radar,c_radar,g_radar,
																	fuselage,c_fuselage,g_fuselage,
																	wing,c_wing,g_wing,
																	engine,c_engine,g_engine,
																	coating,c_coating,g_coating,
																	radiating,c_radiating,g_radiating,
																	ctimer) values 	(`in_planeid`,`in_level`,
																	`in_firecontrol`,`in_c_firecontrol`,`in_g_firecontrol`,
																	`in_radar`,`in_c_radar`,`in_g_radar`,
																	`in_fuselage`,`in_c_fuselage`,`in_g_fuselage`,
																	`in_wing`,`in_c_wing`,`in_g_wing`,
																	`in_engine`,`in_c_engine`,`in_g_engine`,
																	`in_coating`,`in_c_coating`,`in_g_coating`,
																	`in_radiating`,`in_c_radiating`,`in_g_radiating`,now());
END
;;
DELIMITER ;

