BEGIN
	delete from game_actsql where userid = `in_userid` and actid = `in_actid`;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `game_actsql_select`
-- ----------------------------
DROP PROCEDURE IF EXISTS `game_actsql_select`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `game_actsql_select`(IN `in_userid` int)
BEGIN
	select actid,status,data0,data1,data2 from game_actsql where userid = `in_userid`;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `game_actsql_update`
-- ----------------------------
DROP PROCEDURE IF EXISTS `game_actsql_update`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `game_actsql_update`(IN `in_userid` int,IN `in_actid` int,IN `in_status` int,IN `in_data0` int,IN `in_data1` int,IN `in_data2` varchar(255))
BEGIN
	if `in_status` = 0 and `in_data0` = 0 and  `in_data1` = 0 and `in_data2` = '' then
		delete from game_actsql where userid = `in_userid` and actid = `in_actid`;
	else
		select count(id) from game_actsql where userid = `in_userid` and actid = `in_actid` into @nNum;
		if @nNum > 0 then
			update game_actsql set status = `in_status`,data0 = `in_data0`,data1 = `in_data1`,data2 = `in_data2` where userid = `in_userid` and actid = `in_actid`;
		else
		end if;
	end if;
END
;;
DELIMITER ;

