END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `game_chip_page_update`
-- ----------------------------
DROP PROCEDURE IF EXISTS `game_chip_page_update`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `game_chip_page_update`(IN `in_userid` int,IN `in_planeid` int,IN `in_pageindex` int,
																			IN `in_c0_0` int,IN `in_c1_0` int,IN `in_c2_0` int,IN `in_c3_0` int,IN `in_c4_0` int,IN `in_c5_0` int,IN `in_c6_0` int,
																			IN `in_c0_1` int,IN `in_c1_1` int,IN `in_c2_1` int,IN `in_c3_1` int,IN `in_c4_1` int,IN `in_c5_1` int,IN `in_c6_1` int,
																			IN `in_c0_2` int,IN `in_c1_2` int,IN `in_c2_2` int,IN `in_c3_2` int,IN `in_c4_2` int,IN `in_c5_2` int,IN `in_c6_2` int)
BEGIN
	select count(id) from game_chip_page where userid = `in_userid` and planeid = `in_planeid` and pageindex = `in_pageindex` into @nNum;
	if @nNum > 0 then
		update game_chip_page set c0_0 = `in_c0_0`,c1_0 = `in_c1_0`,c2_0 = `in_c2_0`,c3_0 = `in_c3_0`,c4_0 = `in_c4_0`,c5_0 = `in_c5_0`,c6_0 = `in_c6_0`,
													  c0_1 = `in_c0_1`,c1_1 = `in_c1_1`,c2_1 = `in_c2_1`,c3_1 = `in_c3_1`,c4_1 = `in_c4_1`,c5_1 = `in_c5_1`,c6_1 = `in_c6_1`,
													  c0_2 = `in_c0_2`,c1_2 = `in_c1_2`,c2_2 = `in_c2_2`,c3_2 = `in_c3_2`,c4_2 = `in_c4_2`,c5_2 = `in_c5_2`,c6_2 = `in_c6_2`
													 where userid = `in_userid` and planeid = `in_planeid` and pageindex = `in_pageindex` ;
	else
										c0_0,c1_0,c2_0,c3_0,c4_0,c5_0,c6_0,c0_1,
										c1_1,c2_1,c3_1,c4_1,c5_1,c6_1,c0_2,
										c1_2,c2_2,c3_2,c4_2,c5_2,c6_2,ctimer) values (`in_userid`,`in_planeid`,`in_pageindex`,
										`in_c0_0`,`in_c1_0`,`in_c2_0`,`in_c3_0`,`in_c4_0`,`in_c5_0`,`in_c6_0`,
										`in_c0_1`,`in_c1_1`,`in_c2_1`,`in_c3_1`,`in_c4_1`,`in_c5_1`,`in_c6_1`,
										`in_c0_2`,`in_c1_2`,`in_c2_2`,`in_c3_2`,`in_c4_2`,`in_c5_2`,`in_c6_2`,
										now());
	end if;
END
;;
DELIMITER ;

