-- ----------------------------
DROP PROCEDURE IF EXISTS `log_item_create`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `log_item_create`(IN `nMon` int)
BEGIN
	set @sql_table = concat(
		'CREATE TABLE IF NOT EXISTS `log_item',`nMon`,
		'` (
			  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
			  `userid` int(11) NOT NULL DEFAULT \'0\' COMMENT \'用户编号\',
			  `svrid` int(11) NOT NULL DEFAULT \'0\' COMMENT \'服务器id\',
			  `sid` int(11) NOT NULL DEFAULT \'0\' COMMENT \'渠道id\',
			  `langid` int(11) NOT NULL DEFAULT \'0\' COMMENT \'语言id\',
			  `itemid` int(11) NOT NULL DEFAULT \'0\' COMMENT \'物品Id\',
			  `itemnum` int(11) NOT NULL DEFAULT \'0\' COMMENT \'物品数量\',
			  `opid` int(11) NOT NULL DEFAULT \'0\' COMMENT \'操作Id\',
			  `srcid` int(11) NOT NULL DEFAULT \'0\' COMMENT \'来源物品Id\',
			  `srcnum` int(11) NOT NULL DEFAULT \'0\' COMMENT \'来源物品数量\',
			  `oldnum` bigint(20) NOT NULL DEFAULT \'0\' COMMENT \'原来数量\',
			  `newnum` bigint(20) NOT NULL DEFAULT \'0\' COMMENT \'新的数量\',
			  `des` varchar(191) NOT NULL DEFAULT \'0\' COMMENT \'附加描述\',
			  `ctimer` timestamp NOT NULL DEFAULT \'1980-01-01 00:00:00\' COMMENT \'创建时间\',
			  PRIMARY KEY (`id`),
			  KEY `sid` (`sid`),
			  KEY `opid` (`opid`),
			  KEY `svrid` (`svrid`),
			  KEY `userid` (`userid`),
			  KEY `ctimer` (`ctimer`),
			  KEY `itemid` (`itemid`)
		) ENGINE=InnoDB;');
	prepare sql_t from @sql_table;
	execute sql_t;
END
;;
DELIMITER ;

-- ----------------------------
