BEGIN
	select  FROM_UNIXTIME(UNIX_TIMESTAMP(now()),'%Y%m') into @nMon;
	call log_item_create(@nMon);
	#
	set @sql_table = concat('insert into log_item',@nMon,' (userid,svrid,sid,langid,itemid,itemnum,opid,srcid,srcnum,oldnum,newnum,des,ctimer) values (',`in_userid`,',',`in_svrid`,',',`in_sid`,',',`in_langid`,',',`in_itemid`,',',`in_itemnum`,',',`in_opid`,',',`in_srcid`,',',`in_srcnum`,',',`in_oldnum`,',',`in_newnum`,',\'',`in_des`,'\',now());');
	prepare sql_t from @sql_table;
	execute sql_t;
END
;;
