-- ----------------------------
-- Procedure structure for `log_retain_calcu`
-- ----------------------------
DROP PROCEDURE IF EXISTS `log_retain_calcu`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `log_retain_calcu`(IN `in_date` varchar(255))
BEGIN
	declare i int;
	set i = 0;
	
	SELECT UNIX_TIMESTAMP(`in_date`) into @nTimer;
	SELECT DATE_FORMAT(`in_date`,'%Y%m') into @nMon;
	SELECT DATE_FORMAT(`in_date`,'%Y%m%d') into @nDate;
	
	DROP TABLE IF EXISTS `log_retain`;
	CREATE TABLE `log_retain` (
	  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
	  `userid` int(11) NOT NULL DEFAULT '0' COMMENT '玩家id',
	  `date2` int(11) NOT NULL DEFAULT '0' COMMENT '是否第二天登录',
	  `date3` int(11) NOT NULL DEFAULT '0' COMMENT '是否第三天登录',
	  `date4` int(11) NOT NULL DEFAULT '0' COMMENT '是否第四天登录',
	  `date5` int(11) NOT NULL DEFAULT '0' COMMENT '是否第五天登录',
	  `date6` int(11) NOT NULL DEFAULT '0' COMMENT '是否第六天登录',
	  `date7` int(11) NOT NULL DEFAULT '0' COMMENT '是否第七天登录',
	  `ctimer` timestamp NOT NULL DEFAULT '1980-01-01 00:00:00' COMMENT '创建时间',
	  PRIMARY KEY (`id`),
	  KEY `ctimer` (`ctimer`),
	  UNIQUE KEY `userid` (`userid`)
	) ENGINE=InnoDB;
	
	SELECT FROM_UNIXTIME(@nTimer,'%Y-%m-%d') into @strBTimer;
	SELECT UNIX_TIMESTAMP(@strBTimer) into @nBTimer;
	SELECT @nBTimer + 24 * 3600 into @nETimer;
	SELECT FROM_UNIXTIME(@nETimer,'%Y-%m-%d') into @strETimer;
	set @sql_table = concat('insert into log_retain (userid,ctimer) select userid,ctimer from log_userlogin',@nMon,' where type = 0 and ctimer >= \'',@strBTimer,'\' and ctimer < \'',@strETimer,'\';');
	prepare sql_t from @sql_table;
	execute sql_t;
	
	select count(id) from log_retain into @nCount;
	while i < @nCount do
		set @sql_table = concat('select userid from log_retain limit ',i,',1 into @nUserId;');
		prepare sql_t from @sql_table;
		execute sql_t;
		
		call log_retain_date_calcu(@nBTimer,@nMon,1,@nUserId);
		call log_retain_date_calcu(@nBTimer,@nMon,2,@nUserId);
		call log_retain_date_calcu(@nBTimer,@nMon,3,@nUserId);
		call log_retain_date_calcu(@nBTimer,@nMon,4,@nUserId);
		call log_retain_date_calcu(@nBTimer,@nMon,5,@nUserId);
		call log_retain_date_calcu(@nBTimer,@nMon,6,@nUserId);
		
		set i = i + 1;
	end while;
	
	set @sql_table = concat('DROP TABLE IF EXISTS log_retain',@nDate,';');
	prepare sql_t from @sql_table;
	execute sql_t;
	
	set @sql_table = concat('rename table log_retain to log_retain',@nDate,';');
	prepare sql_t from @sql_table;
	execute sql_t;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `log_retain_date_calcu`
-- ----------------------------
DROP PROCEDURE IF EXISTS `log_retain_date_calcu`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `log_retain_date_calcu`(IN `in_date` int,IN `in_mon` int,IN `in_index` int,IN `in_userid` int)
BEGIN
	SELECT `in_date` + `in_index` * 24 * 3600 into @nLBTimer;
	SELECT FROM_UNIXTIME(@nLBTimer,'%Y-%m-%d') into @strLBTimer;
	SELECT `in_date` + (`in_index` + 1)  * 24 * 3600 into @nLETimer;
	SELECT FROM_UNIXTIME(@nLETimer,'%Y-%m-%d') into @strLETimer;
	
	SELECT DATE_FORMAT(@strLBTimer,'%Y%m') into @nNewMon;
	
	set @sql_table = concat('select count(id) from log_userlogin',@nNewMon,' where ctimer >= \'',@strLBTimer,'\' and ctimer < \'',@strLETimer,'\' and userid = ',`in_userid`,' into @nLNum;');
	prepare sql_t from @sql_table;
	execute sql_t;
	
	if @nLNum > 0 then
		set @sql_table = concat('update log_retain set date',`in_index` + 1,' = 1 where userid = ',`in_userid`,';');
		prepare sql_t from @sql_table;
		execute sql_t;
	end if;
END
;;
DELIMITER ;

