BEGIN
	set @sql_table = concat(
		'CREATE TABLE IF NOT EXISTS `log_shop',`nMon`,
		'` (
			  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
			  `userid` int(11) NOT NULL DEFAULT \'0\' COMMENT \'用户编号\',
			  `svrid` int(11) NOT NULL DEFAULT \'0\' COMMENT \'服务器id\',
			  `sid` int(11) NOT NULL DEFAULT \'0\' COMMENT \'渠道id\',
			  `langid` int(11) NOT NULL DEFAULT \'0\' COMMENT \'语言id\',
			  `shopid` int(11) NOT NULL DEFAULT \'0\' COMMENT \'商品编号Id\',
			  `shopnum` int(11) NOT NULL DEFAULT \'0\' COMMENT \'商品数量\',
			  `useid` int(11) NOT NULL DEFAULT \'0\' COMMENT \'使用的货币Id\',
			  `usenum` int(11) NOT NULL DEFAULT \'0\' COMMENT \'使用的货币数量\',
			  `des` varchar(191) NOT NULL DEFAULT \'0\' COMMENT \'附加描述\',
			  `ctimer` timestamp NOT NULL DEFAULT \'1980-01-01 00:00:00\' COMMENT \'创建时间\',
			  PRIMARY KEY (`id`),
			  KEY `sid` (`sid`),
			  KEY `svrid` (`svrid`),
			  KEY `userid` (`userid`),
			  KEY `ctimer` (`ctimer`),
			  KEY `shopid` (`shopid`)
		) ENGINE=InnoDB;');
	prepare sql_t from @sql_table;
	execute sql_t;
END
;;
DELIMITER ;

