-- ----------------------------
-- Procedure structure for `user_fight_info_insert`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_fight_info_insert`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_fight_info_insert`(IN `in_userid` int,IN `in_modelid` int,IN `in_win` int,IN `in_kill` int,IN `in_dead` int,IN `in_killex` int,IN `in_kda` float)
BEGIN
	select count(id),id,fnum,fwin,fkill,fkillex,fdead,fkda_max from user_fight_info where userid = `in_userid` and modelid = `in_modelid` into @nNum,@nId,@nFNum,@nFWin,@nKill,@nKillEx,@nDead,@nFKDAMax;
	if @nNum > 0 then
		if @nDead > 0 then
			select (@nKill + 0.7 * @nKillEx) / @nDead into @fKDA;
		else
			select @nKill + 0.7 * @nKillEx into @fKDA;
		end if;
		if `in_kda` > @nFKDAMax then
			select `in_kda` into @nFKDAMax;
		end if;
		select  FLOOR((@nFWin + `in_win`) * 10000 / (@nFNum + 1)) into @nFWR;
		update user_fight_info set fnum = fnum + 1,fwin = fwin +`in_win`,fkill = fkill + `in_kill`,fdead = fdead + `in_dead`,fkillex = fkillex + `in_killex`,fwinrate = @nFWR,fkda = @fKDA,fkda_max = @nFKDAMax,utimer = now()  where id = @nId;
	else
	end if;
#	if `in_modelid` != 0 then
#		call user_fight_info_insert`(`in_userid`,0,`in_win`,`in_kill`,`in_dead`,`in_killex`,`in_kda`)
#	end if;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `user_friendinv_accept`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_friendinv_accept`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_friendinv_accept`(IN `in_userid` int,IN `in_friendid` int,IN `in_maxfriend` int)
BEGIN
	select count(id) from user_friendinv where friendid = `in_userid` and userid = `in_friendid` into @nNum;
	if @nNum < 1 then
		select 2;#没有申请表
	else
		select count(id) from user_friend where userid = `in_userid` into @nNum;
		if @nNum > `in_maxfriend` then
			select 3;#自己好友列表已满
		else
			select count(id) from user_friend where userid = `in_friendid` into @nNum;
			if @nNum > `in_maxfriend` then
				select 4;#对方好友列表已满
			else
				call user_friend_insert(`in_userid`,`in_friendid`);
				#删除双方的申请
				delete from user_friendinv where userid = `in_userid` and friendid = `in_friendid`;
				delete from user_friendinv where userid = `in_friendid` and friendid = `in_userid`;
				select 0;
			end if;
		end if;
	end if;
END
;;
DELIMITER ;

