-- ----------------------------
-- Procedure structure for `user_friendinv_insert`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_friendinv_insert`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_friendinv_insert`(IN `in_userid` int,IN `in_friendid` int,IN `in_title` varchar(255))
BEGIN
	if `in_userid` != `in_friendid` then
		#判断对方是否为好友
		select count(id) from user_friend where userid = `in_userid` and friendid = `in_friendid` into @nNum;
		if @nNum > 0 then
			select 2,"";
		else
			#判断对方申请的个数是否满了
			select count(id) from user_friendinv where friendid = `in_friendid` into @nNum;
			if @nNum > 255 then
				select 3,"";
			else
				select count(id) from user_friendinv where userid = `in_userid` and friendid = `in_friendid` into @nNum;
				if @nNum > 0 then
					select 5,'';
				else
					select 0,`in_title`;
				end if;
			end if;
		end if;
	else
		select 1,"";
	end if;
END
;;
DELIMITER ;

