-- ----------------------------
-- Procedure structure for `user_info_insert`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_info_insert`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_info_insert`(IN `in_userid` int,IN `in_sid` int,IN `in_langid` int,IN `in_nick` Varchar(191),IN `in_device` Varchar(191),IN `in_openid` Varchar(191),IN `in_dia` int,IN `in_gold` int,IN `in_planeid` int,
						IN `in_misid` int,IN `in_canid` int,IN `in_skinid` int,IN `in_iconid` int,IN `in_iconexid` int,IN `in_specid0` int,IN `in_specid1` int,IN `in_maneact0` int,IN `in_maneact1` int,IN `in_maneact2` int,IN `in_maneact3` int)
BEGIN
	#  插入玩家飞机及其它
	call game_item_update(`in_userid`,`in_misid`,1);#增加默认导弹
	call game_item_update(`in_userid`,`in_canid`,1);#增加默认机炮
	call game_item_update(`in_userid`,`in_skinid`,1);#增加默认皮肤
	call game_plane_update_level(`in_userid`,`in_planeid`,1,0,`in_skinid`);#增加默认飞机
	if `in_iconid` > 0 then
		call game_item_update(`in_userid`,`in_iconid`,1);#增加默认头像
	end if;
	if `in_iconexid` > 0 then
		call game_item_update(`in_userid`,`in_iconexid`,1);#增加默认头像框
	end if;
	call game_chip_page_update_nick(`in_userid`,`in_planeid`,0,'');#增加三个芯片页
	call game_chip_page_update_nick(`in_userid`,`in_planeid`,1,'');#增加三个芯片页
	call game_chip_page_update_nick(`in_userid`,`in_planeid`,2,'');#增加三个芯片页
	call game_plane_cfg_insert(`in_userid`,0,'',1,`in_planeid`,`in_skinid`,`in_misid`,`in_canid`,`in_specid0`,`in_specid1`,`in_maneact0`,`in_maneact1`,`in_maneact2`,`in_maneact3`);#增加默认出战配置页
	call game_plane_cfg_insert(`in_userid`,1,'',0,`in_planeid`,`in_skinid`,`in_misid`,`in_canid`,`in_specid0`,`in_specid1`,`in_maneact0`,`in_maneact1`,`in_maneact2`,`in_maneact3`);#增加默认出战配置页
END
;;
DELIMITER ;

