-- ----------------------------
-- Procedure structure for `user_info_nick_rand`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_info_nick_rand`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_info_nick_rand`()
BEGIN
	declare szOut varchar(191);
	call user_info_nick_rand_ex(@szOut);
	select @szOut;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `user_info_nick_rand_ex`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_info_nick_rand_ex`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_info_nick_rand_ex`(OUT `in_nick` varchar(191))
BEGIN
	declare i int;
	declare nRet int;
	declare szOut varchar(191);
	#
	set i = 0;
	set nRet = 0;
	#
	while i < 10000 do
		call user_info_nick_rand_out(szOut,nRet);
		if nRet > 0 then
			set i = 100000;
			select szOut into `in_nick`;
		else
			set i = i + 1;
		end if;
	end while;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `user_info_nick_rand_out`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_info_nick_rand_out`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_info_nick_rand_out`(OUT `in_nick` varchar(191),OUT `in_ret` int)
BEGIN
	DECLARE nRandNick INT;
	set nRandNick = 0;
	SELECT count(*) FROM user_info_datanick into @nNickCount;
	SELECT floor(RAND() * @nNickCount) into nRandNick;
	select nickname from user_info_datanick LIMIT nRandNick,1 into @szNick;
	select count(id) from user_info where nickname = @szNick into @nNum;
	if @nNum > 0 then
		select FLOOR(RAND() * 100000) into @nRand;
		select CONCAT(@szNick,@nRand) into @szNickRand;
		select count(id) from user_info where nickname = @szNickRand into @nNum;
		if @nNum > 0 then
			select 0 into `in_ret`;
			select '' into `in_nick`;
		else
			select 1 into `in_ret`;
			select @szNickRand into `in_nick`;
		end if;
	else
		select 1 into `in_ret`;
		select @szNick into `in_nick`;
	end if;
END
;;
DELIMITER ;

