-- ----------------------------
-- Procedure structure for `user_info_search`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_info_search`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_info_search`(IN `in_searchid` int,IN `in_searchnick` varchar(191))
BEGIN
	select 0 into @nNum;
	select 0 into @nSearchId;
	if `in_searchid` = 0 then#搜索昵称
		select count(id) from user_info where nickname = `in_searchnick` into @nNum;
		if @nNum < 1 then#没有玩家，3表示没有玩家
			select 3,0;
		else#找到玩家，0表示成功找到玩家
			select 0,userid from user_info where nickname = `in_searchnick`;
		end if;
	else#搜索玩家Id
		select count(id) from user_info where userid = `in_searchid` into @nNum;
		if @nNum < 1 then#没有玩家，3表示没有玩家
			select 3,0;
		else#找到玩家，0表示成功找到玩家
			select 0,`in_searchid`;
		end if;
	end if;
END
;;
DELIMITER ;

