-- ----------------------------
-- Procedure structure for `user_ord_fight_info_insert`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_ord_fight_info_insert`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_ord_fight_info_insert`(IN `in_userid` int,IN `in_win` int,IN `in_kill` int,IN `in_dead` int,IN `in_killex` int)
BEGIN
	select count(id),id,fnum,fwin,fkill,fkillex,fdead from user_ord_fight_info where userid = `in_userid` into @nNum,@nId,@nFNum,@nFWin,@nKill,@nKillEx,@nDead;
	if @nNum > 0 then
		select  FLOOR((@nFWin + `in_win`) * 10000 / (@nFNum + 1)) into @nFWR;
		update user_ord_fight_info set fnum = fnum + 1,fwin = fwin +`in_win`,fkill = fkill + `in_kill`,fdead = fdead + `in_dead`,fkillex = fkillex + `in_killex`,fwinrate = @nFWR,utimer = now()  where id = @nId;
	else
	end if;
END
;;
DELIMITER ;

