-- ----------------------------
-- Procedure structure for `user_ph_select`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_ph_select`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_ph_select`(IN `in_modelid` int,IN `in_type` int)
BEGIN
	if `in_type` = 1001 then#主线任务排行榜
		SELECT userid,max(stage) as mstage FROM `game_stage` WHERE num > 0 GROUP BY userid ORDER BY mstage DESC LIMIT 50;
	elseif `in_type` = 2001 then#小队竞技排行榜，累计击落
		SELECT userid,fkill FROM `user_fight_info` WHERE modelid =  `in_modelid` and fkill > 0 ORDER BY fkill DESC,utimer ASC LIMIT 50;
	elseif `in_type` = 2002 then#小队竞技排行榜，胜率
		SELECT userid,fwinrate FROM `user_fight_info` WHERE modelid =  `in_modelid` and fnum >= 10 ORDER BY fwinrate DESC LIMIT 50;
	elseif `in_type` = 2003 then#小队竞技排行榜，场均KDA
		SELECT userid,fkda*100 FROM `user_fight_info` WHERE modelid =  `in_modelid` and fnum >= 10 ORDER BY fkda DESC LIMIT 50;
	elseif `in_type` = 3001 then#排位赛排行榜，段位积分
		SELECT userid,level,expall FROM `user_rank_info` WHERE rankid =  `in_modelid` and fightnum >= 10 ORDER BY expall DESC,expmaxtimer ASC LIMIT 50;
	elseif `in_type` = 3002 then#排位赛排行榜，累计击落
		SELECT userid,fkill FROM `user_rank_info` WHERE rankid =  `in_modelid` and fightnum >= 10 and fkill > 0 ORDER BY fkill DESC,utimer ASC LIMIT 50;
	elseif `in_type` = 3003 then#排位赛排行榜，胜率
		SELECT userid,fwinrate FROM `user_rank_info` WHERE rankid =  `in_modelid` and fightnum >= 10 ORDER BY fwinrate DESC LIMIT 50;
	elseif `in_type` = 3004 then#排位赛排行榜，场均KDA
		SELECT userid,fkda*100 FROM `user_rank_info` WHERE rankid =  `in_modelid` and fightnum >= 10 ORDER BY fkda DESC LIMIT 50;
	end if;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `user_ph_select_self`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_ph_select_self`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_ph_select_self`(IN `in_userid` int,IN `in_modelid` int,IN `in_type` int)
BEGIN
	if `in_type` = 1001 then#主线任务排行榜
		select stage from game_stage where userid = `in_userid` order by stage desc limit 1;
	elseif `in_type` = 2001 then#小队竞技排行榜，累计击落
		select fkill FROM `user_fight_info` WHERE userid = `in_userid` and modelid =  `in_modelid`;
	elseif `in_type` = 2002 then#小队竞技排行榜，胜率
		select fwinrate FROM `user_fight_info` WHERE userid = `in_userid` and modelid =  `in_modelid`;
	elseif `in_type` = 2003 then#小队竞技排行榜，场均KDA
		select fkda*100 FROM `user_fight_info` WHERE userid = `in_userid` and modelid =  `in_modelid`;
	elseif `in_type` = 3001 then#排位赛排行榜，段位积分
		select level FROM `user_rank_info` WHERE userid = `in_userid` and rankid = `in_modelid`;
	elseif `in_type` = 3002 then#排位赛排行榜，累计击落
		select fkill FROM `user_rank_info` WHERE userid = `in_userid` and rankid = `in_modelid`;
	elseif `in_type` = 3003 then#排位赛排行榜，胜率
		select fwinrate FROM `user_rank_info` WHERE userid = `in_userid` and rankid = `in_modelid`;
	elseif `in_type` = 3004 then#排位赛排行榜，场均KDA
		select fkda*100 FROM `user_rank_info` WHERE userid = `in_userid` and rankid = `in_modelid`;
	end if;
END
;;
DELIMITER ;

