-- ----------------------------
-- Procedure structure for `user_qq_extrainfo_update`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_qq_extrainfo_update`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_qq_extrainfo_update`(IN `in_userid` int,IN `in_account` varchar(191),IN `in_score` int,IN `in_level` int,IN `in_binding` int,IN `in_discount` int,IN `in_payReturnCount` int,IN `in_isUsingCard` int,IN `in_realLevel` int)
BEGIN
	#程序中获得最新post数据，然后写入到这里
	select count(id) from user_qq_extrainfo where userid = `in_userid` into @nNum;
	if @nNum > 0 then
		update user_qq_extrainfo set account = `in_account`,score = `in_score`,level = `in_level`,binding = `in_binding`,discount = `in_discount`,payReturnCount = `in_payReturnCount`,isUsingCard = `in_isUsingCard`,realLevel = `in_realLevel` where userid = `in_userid`;
	else
	end if;
	update user_info set qqcalevel = `in_level` where userid = `in_userid`;
END
;;
DELIMITER ;

