-- ----------------------------
-- Procedure structure for `user_rank_info_update`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_rank_info_update`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_rank_info_update`(IN `in_userid` int,IN `in_rankid` int,IN `in_level` int,IN `in_lexp` int,IN `in_levelmax` int,IN `in_fightnum` int,IN `in_fwin` int,	IN `in_fwin_max` int,
							IN `in_fwin_cur` int,IN `in_fkill` int,IN `in_fdead` int,IN `in_fkillex` int,IN `in_fhurt_mis` int,IN `in_fhurt_can` int,IN `in_fhurted_mis` int,IN `in_fhurted_can` int,
							IN `in_fall_mis` int,IN `in_fhit_mis` int,IN `in_fall_can` int,IN `in_fhit_can` int,IN `in_fhurt_max` int,IN `in_fkill_max` int,IN `in_fkillex_max` int,IN `in_fkillone` int,IN `in_fkda` float,
							IN `in_expall` int,IN `in_expmax` int,IN `in_expmaxtimer` int,IN `in_mmr` float,IN `in_mmr_m2` float,IN `in_mmr_m4` float,IN `in_mvp` int,IN `in_fkda_max` float)
BEGIN
	select 0 into @nFWR;
	if `in_fightnum` > 0 then
		select  FLOOR(`in_fwin` * 10000 / `in_fightnum`) into @nFWR;
	end if;
	select count(id) from user_rank_info where userid = `in_userid` and rankid = `in_rankid` into @nNum;
	if @nNum > 0 then
		update user_rank_info set level = `in_level`,lexp = `in_lexp`,levelmax =  `in_levelmax`,fightnum = `in_fightnum`,fwin = `in_fwin`,fwin_max = `in_fwin_max`,
						fwin_cur = `in_fwin_cur`,fkill = `in_fkill`,fdead = `in_fdead`,fkillex = `in_fkillex`,fhurt_mis = `in_fhurt_mis`,fhurt_can = `in_fhurt_can`,
						fhurted_mis = `in_fhurted_mis`,fhurted_can = `in_fhurted_can`,fall_mis = `in_fall_mis`,fhit_mis = `in_fhit_mis`,fall_can = `in_fall_can`,fhit_can = `in_fhit_can`,
						fhurt_max = `in_fhurt_max`,fkill_max = `in_fkill_max`,fkillex_max = `in_fkillex_max`,fkillone = `in_fkillone`,fkda = `in_fkda`,
						expall = `in_expall`,expmax = `in_expmax`,expmaxtimer = `in_expmaxtimer`,fwinrate = @nFWR,mmr = `in_mmr`,mmr_m2 = `in_mmr_m2`,mmr_m4 = `in_mmr_m4`,
						fmvp = `in_mvp`,fkda_max = `in_fkda_max`,utimer = now() where userid = `in_userid` and rankid = `in_rankid`;
	else
						fhurted_mis,fhurted_can,fall_mis,fhit_mis,fall_can,fhit_can,	fhurt_max,fkill_max,fkillex_max,fkillone,fkda,
						expall,expmax,expmaxtimer,fwinrate,mmr,mmr_m2,mmr_m4,fmvp,fkda_max,ctimer,utimer) values 
						(`in_userid`,`in_rankid`,`in_level`,`in_lexp`,`in_levelmax`,`in_fightnum`,`in_fwin`,`in_fwin_max`,`in_fwin_cur`,`in_fkill`,`in_fdead`,`in_fkillex`,`in_fhurt_mis`,`in_fhurt_can`,
						`in_fhurted_mis`,`in_fhurted_can`,`in_fall_mis`,`in_fhit_mis`,`in_fall_can`,`in_fhit_can`,`in_fhurt_max`,`in_fkill_max`,`in_fkillex_max`,`in_fkillone`,`in_fkda`,
						`in_expall`,`in_expmax`,`in_expmaxtimer`,@nFWR,`in_mmr`,`in_mmr_m2`,`in_mmr_m4`,`in_mvp`,`in_fkda_max`,now(),now());
	end if;
END
;;
DELIMITER ;

