-- ----------------------------
-- Procedure structure for `user_recharge_select_gold_num`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_recharge_select_gold_num`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_recharge_select_gold_num`(IN `in_userid` int,IN `in_valid` int,IN `in_dbtimer` varchar(255),IN `in_detimer` varchar(255),IN `in_mbtimer` varchar(255),IN `in_metimer` varchar(255))
BEGIN
	if `in_valid` > 0 then
		select sum(gold) from user_recharge where userid = `in_userid` and ctimer >= `in_dbtimer` and ctimer < `in_detimer` into @nDate;
		select sum(gold) from user_recharge where userid = `in_userid` and ctimer >= `in_mbtimer` and ctimer < `in_metimer` into @nMon;
		if isnull(@nDate) then
			select 0 into @nDate;
		end if;
		if isnull(@nMon) then
			select 0 into @nMon;
		end if;
		select @nDate,@nMon,10000,40000;
	else
		select 0,0,2000000000,2000000000;
	end if;
END
;;
DELIMITER ;

