DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_recharge_select_user`()
BEGIN
	select distinct userid from user_recharge where valid = 1 and ctimer >= FROM_UNIXTIME(UNIX_TIMESTAMP(NOW()) - 24 * 3600);
END
;;
