-- ----------------------------
-- Procedure structure for `user_yeka_update_yk`
-- ----------------------------
DROP PROCEDURE IF EXISTS `user_yeka_update_yk`;
DELIMITER ;;
CREATE DEFINER=`gamecs`@`%` PROCEDURE `user_yeka_update_yk`(IN `in_userid` int,IN `in_tka` int)
BEGIN
	#月卡获得
	select UNIX_TIMESTAMP(now()) into @nNow;
	select count(*) from user_yeka where userid = `in_userid` and tka = `in_tka` into @nNum;
	if @nNum > 0 then
		select id,etimer from user_yeka where userid = `in_userid` and tka = `in_tka` limit 1 into @nId,@nETimer;
		if @nETimer < @nNow then#月卡过期了
			update user_yeka set etimer = @nNow + 30 * 24 * 3600 where id = @nId;
		else
			update user_yeka set etimer = @eTimer + 30 * 24 * 3600 where id = @nId;
		end if;
	else
	end if;
END
;;
DELIMITER ;
